1) leading America to victory through "peace without surrender" during WWI as a Democrat and the second president to serve two terms from 1913-1921 after Theodore Roosevelt. His vice presidents included Thomas Riley Marshall (from Indiana), James S. Sherman (who died in office - New York), and then Charles W. Fairbanks (Indiana) who finished out Wilson’s second term until Republican Warren G. Harding took over;
2) creating the first U.S. governmental agency that would later become known as the Federal Reserve System under the Act of Congress in 1914 “to provide for the establishment of rural credit unions, also known as cooperative banks” which had roots in earlier legislation; he established The Farm Loan Commissioner position within the Department of Agriculture at the request of southern farmers struggling post Civil War and due to issues with railroad monopolies;
3) taking action against trust organizations that hurt American competition like JP Morgan & Co bank and led directly to the Clayton Antitrust Act passage 106 years ago next month February 15th with former Senator James Beall of Ohio as Attorney General working on this effort; prior to this in the early 1870s there were anti-trust laws starting getting passed by US states. Then there was later adoption nationally and state level following these acts such as the Sherman Antitrust Act that Woodrow helped uphold via Supreme Court cases against them. These efforts help stop vertical price fixing across industries because businesses could own other companies horizontally so they wouldn’t have to compete or charge their consumers less if not buy/merge acquiring outright competitors using the stock market via investment;

